import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import { ScreeningRecruiter } from './containers/Screening/Recruiter';

import './index.scss';

export function App() {
  return (
    <BrowserRouter>
        <div>Dummy Data</div>
        <Routes>
            <Route path='/screening/recruiter' element={ScreeningRecruiter} />
        </Routes>
    </BrowserRouter>
  );
}
